import React, { Component } from "react";
import "./SeoulRouteMakerStyle.css";

export class SeoulRouteMaker extends Component {
  render() {
    return (
      <>
        <style>
          @import
          url('https://fonts.googleapis.com/css?family=Dancing+Script&display=swap');
        </style>
        <div className="SeoulRouteMaker_MyBook">
          <div style={{ position: "absolute", fontSize: "20px", marginTop: "10px", marginLeft: "20px", }}>Seoul Route Maker</div>
          <div style={{ position: "absolute" }}>
            <p>
              This Project is ought to design for the people who want explore
              extra-ordinary place which is either familiar or unfamiliar region
            </p>
          </div>
          <div className="SeoulRouteMaker_Cover">
            <figure className="SeoulRouteMaker_front">
              <h1
                style={{
                  fontWeight: "bold",
                  fontFamily: "Dancing Script, cursive",
                  fontSize: "40px"
                }}
              >
                Seoul Route Maker
              </h1>
              <h4 style={{}}>-DataBase Team Project-</h4>
            </figure>
            <figure className="SeoulRouteMaker_back"> back </figure>
          </div>
        </div>
      </>
    );
  }
}

export default SeoulRouteMaker;
